INSERT INTO `information_description` (`information_id`, `language_id`, `title`, `description`, `meta_description`, `meta_keyword`, `seo_title`, `seo_h1`) VALUES
(4, 1, 'AlpStandart.com', '&lt;p&gt;\r\n	AlpStandart.com&lt;/p&gt;\r\n', 'AlpStandart.com', 'AlpStandart.com', 'AlpStandart.com', 'AlpStandart.com'),
(5, 1, 'Условия соглашения', '&lt;p&gt;\r\n	Скоро тут появятся условия соглашения&lt;/p&gt;\r\n', 'Условия соглашения', 'Условия соглашения', 'Условия соглашения', 'Условия соглашения'),
(11, 1, 'Скидки', '&lt;p&gt;\r\n	В &lt;a href=&quot;/&quot;&gt;интернет-магазине Osprey&lt;/a&gt; действуют такие акции:&lt;/p&gt;\r\n&lt;br /&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;1. &quot;Нашли дешевле? - получите скидку&quot;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;p&gt;\r\n	&lt;img alt=&quot;Нашли дешевле? - получите скидку&quot; src=&quot;/image/data/logos/discount.jpg&quot; style=&quot;width: 200px; height: 200px;&quot; /&gt;&lt;/p&gt;\r\n&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;p&gt;\r\n	Если Вы нашли такой же товар по цене, ниже чем у нас на сайте - Вы можете получить скидку от 5 до 50 грн, в зависимости от товара. При этом в найденном предложении должны выполняться следующие условия:&lt;/p&gt;\r\n&lt;ul&gt;\r\n	&lt;li&gt;\r\n		стоимость товара с доставкой ниже чем в интернет-магазине Osprey&lt;/li&gt;\r\n	&lt;li&gt;\r\n		товар есть в реальном наличии и может быть доставлен&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;\r\n	Если условия выполняются - смело звоните нам и мы сделаем Вам скидку!&lt;/p&gt;\r\n&lt;p&gt;\r\n	Наш телефон (044) &lt;strong&gt;599-55-56&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n', 'Скидки', 'Скидки', 'Скидки', 'Скидки'),
(10, 1, 'Гарантийные обязательства', '&lt;p&gt;\r\n	Скоро тут появятся условия гарантии&lt;/p&gt;\r\n', 'Гарантийные обязательства', 'Гарантийные обязательства', 'Гарантийные обязательства', 'Гарантийные обязательства'),
(6, 1, 'Информация о доставке', '&lt;p&gt;\r\n	В &lt;a href=&quot;/&quot;&gt;интернет-магазине A&lt;/a&gt;&lt;a href=&quot;http://alpstandart.com&quot; target=&quot;_blank&quot;&gt;lpStandart&lt;/a&gt; доставка осуществляется одним из следующих способов:&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;Адресная доставка курьером (Киев)&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	Доставка товаров курьером осуществляется бесплатно при условии, что сумма заказа более 500 грн. При заказе на меньшую сумму, стоимость доставки 35 грн.&lt;/p&gt;\r\n&lt;p&gt;\r\n	Наша курьерская служба осуществляет доставки с 12 до 18, с 18 до 22, либо с 12 до 21, как вам удобно. Курьер предварительно набирает за полчаса до времени прибытия.&lt;/p&gt;\r\n&lt;p&gt;\r\n	Если Вам нужна срочная доставка или доставка в конкретный период времени (минимум 2 часа) - стоимость такой услуги от 70 грн.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;Доставка по Украине &quot;Новой Почтой&quot;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	Мы отправляем товары по Украине через &quot;Новую Почту&quot;. При сумме заказа более 500 грн, мы отправляем товар за наш счет. Вы оплачиваете только обратную пересылку денег. При сумме заказа менее 500 грн, Вы оплачиваете все услуги компании &quot;Новая Почта&quot;.&lt;/p&gt;\r\n&lt;p&gt;\r\n	Для того чтобы платить меньше - пользуйтесь услугой полной предоплаты. Тогда вы оплачиваете только стоимость товара и не платите за услуги доставки.&lt;/p&gt;\r\n&lt;p&gt;\r\n	В любом случае Вы &lt;u&gt;&lt;strong&gt;не оплачиваете&lt;/strong&gt;&lt;/u&gt; отдельно доставку по Киеву до склада &quot;Новой Почты&quot;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;Доставка по Украине другой службой перевозок&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	Мы можем отправить Вам товар с помощью любой другой службы перевозок, как &quot;Интайм&quot;, &quot;Ночной Экспресс&quot;, &quot;Автолюкс&quot;, &quot;Укрпошта&quot; и другие. В таком случае Вы делаете полную предоплату и дополнительно оплачиваете от 35 грн, за доставку и оформление в отделении службы-перевозчика.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;Самовывоз в Шоуруме&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	Вы можете получить заказанный товар в нашем шоуруме. Это значит, что можно посмотреть на товар, примерять его. Возможно, выбрать другой товар из доступных в наличии. Сейчас эта услуга доступна в Киеве (ул. Марии Примаченко 1/27).&lt;/p&gt;\r\n', 'Информация о доставке', 'Информация о доставке', 'Информация о доставке', 'Информация о доставке'),
(8, 1, 'Акции от AlpStandart', '&lt;p&gt;\r\n	Акции от AlpStandart&lt;/p&gt;\r\n', 'Акции от AlpStandart', 'Акции от AlpStandart', 'Акции от AlpStandart', 'Акции от AlpStandart');
