INSERT INTO `news_description` (`news_description_id`, `news_id`, `language_id`, `title`, `description`) VALUES
(37, 2, 1, 'Факты про Osprey', '&lt;p&gt;\r\n	В 1974году Майк Фотенхауэр учредил свою компанию, которая в то время называлась «&lt;strong&gt;Osprey Packs&lt;/strong&gt;». Он всегда вспоминал каким неудобным был рюкзак с которым он, еще будучи мальчишкой, ходил в походы со своим отцом. И Майк захотел это исправить, создав такой рюкзак, который бы идеально сидел и был максимально комфортным и удобным.&lt;/p&gt;\r\n&lt;hr /&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	В 1974году Майк Фотенхауэр учредил свою компанию, которая в то время называлась «&lt;strong&gt;Osprey Packs&lt;/strong&gt;».&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	Он всегда вспоминал каким неудобным был рюкзак с которым он, еще будучи мальчишкой, ходил в походы со своим отцом.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	И Майк захотел это исправить, создав такой рюкзак, который бы идеально сидел и был максимально комфортным и удобным.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	Майк Фотенхауэр сшил свой первый рюкзак в 16 лет и, убедившись в том, что его рюкзаки действительно соответствуют всем требованиям путешественника, он открыл магазинчик.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	В нем каждый желающий мог бы заказать отлично сшитый рюкзак по собственным меркам.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	И вскоре что бы получить такой рюкзак в магазинчик выстроилась очередь.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	Слухи о качестве и удобстве рюкзаков Майка распространялись очень быстро, и вскоре пришлось расширить мастерскую.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	Майк принимает решение продавать свои рюкзаки и в других специализированных магазинах с туристическим снаряжением.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	Вскоре, в 1987 году компания начала оптовую торговлю.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	За долгое время существования компании остается неизменным две вещи: это традиционный узнаваемый во всем мире дизайн, разработанный создателем компании и качество производимого товара.&lt;/p&gt;\r\n'),
(38, 1, 1, 'О продукции Osprey', '&lt;p&gt;\r\n	Каждый товар компании &lt;strong&gt;Osprey&lt;/strong&gt; прошел жесткий контроль качества и был протестирован лучшими специалистами. Путешественники, спортсмены и любители активного образа жизни по достоинству оценят данную продукцию.&lt;/p&gt;\r\n&lt;hr /&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	Каждый товар компании &lt;strong&gt;Osprey&lt;/strong&gt; прошел жесткий контроль качества и был протестирован лучшими специалистами.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	В разработке новых моделей принимали участие знаменитые альпинисты, спортсмены, а так же были учтены и пожелания потребителей.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	Любители активного образа жизни по достоинству оценят данную продукцию.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	Вот уже более 40лет компания &lt;strong&gt;Osprey&lt;/strong&gt; специализируется на производстве туристических и городских рюкзаков, а так же внедряет новейшие разработки, которые наилучшим образом соответствуют потребностям каждого клиента.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	Основанная в 1974 году компания, уже в 1987 году начала оптовую торговлю.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	И с момента создания инженеры и основатели не прекращают усовершенствовать продукцию и воплощать в жизнь все новые и новые идеи.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	Компанией &lt;strong&gt;Osprey&lt;/strong&gt; была разработана модель &lt;u&gt;Isis&lt;/u&gt;, первая в мире модель рюкзака для женщин, технология поясного ремня &lt;u&gt;Custom&lt;/u&gt; &lt;u&gt;Molding&lt;/u&gt; &lt;u&gt;hipbelt&lt;/u&gt; &lt;u&gt;technology&lt;/u&gt;, рюкзак для переноски детей &lt;u&gt;Poco&lt;/u&gt; &lt;u&gt;Child&lt;/u&gt; &lt;u&gt;Carrier&lt;/u&gt; и множество других инноваций, за которые компания получила награды и премии.&lt;/p&gt;\r\n');
