INSERT INTO `product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `seo_title`, `seo_h1`) VALUES
(1, 1, 'Рюкзак Osprey Ace 48L Cherry Shake', '&lt;p&gt;&lt;strong&gt;Рюкзак Osprey Ace 48L Cherry Shake&lt;/strong&gt;. 	Серия Osprey для молодежи отличается специальными размерами рюкзаков для детей. Эти надежные модели высокого качества, которые обладают различными техническими деталями и эргономичной посадкой, - наилучшее снаряжение для молодых спортсменов.&lt;/p&gt;\n&lt;p&gt;\n	&lt;strong&gt;Особые характеристики модели&lt;/strong&gt;:&lt;br /&gt;\n	- Лямки с запасом по длине 12.5 см, которые легко регулируются.&lt;br /&gt;\n	- Не стесняющее активность ребенка просторное углубление под голову.&lt;br /&gt;\n	- Обеспечивающий равномерное распределение нагрузки периферийный каркас.&lt;br /&gt;\n	- Регулируемый 10-ти сантиметровый поясной ремень с запасом по длине.&lt;br /&gt;\n	- Карманы из сетчатого материала на поясном ремне.&lt;br /&gt;\n	- Встроенный дождевик.&lt;/p&gt;\n&lt;p&gt;\n	&lt;strong&gt;Особенности конструкции плечевых ремней&lt;/strong&gt;:&lt;br /&gt;\n	- Сделанный из сплава алюминия 6061 Т6 периферийный каркас.&lt;br /&gt;\n	- Элемент каркаса, сделанный из пластмассы, для жесткости.&lt;br /&gt;\n	- Спинные подушки, для лучшей вентиляции покрыты материалом AirScape&lt;br /&gt;\n	- Поясной ремень, выполненный из наполнителя с подкладкой (выполнен из сетчатого материала для лучшей вентиляции), который регулируется по размеру.&lt;br /&gt;\n	- Плечевые ремни, выполненные из перфорированного наполнителя EVA с подкладкой из сетчатого материала для лучшей вентиляции.&lt;/p&gt;\n&lt;p&gt;\n	&lt;strong&gt;Особенности модели&lt;/strong&gt;:&lt;br /&gt;\n	- Легко регулируемая длинна лямок рюкзака, которую можно изменять по мере роста ребенка.&lt;br /&gt;\n	- Поясной ремень, регулируемый по размеру.&lt;br /&gt;\n	- Обеспечивающий равномерное распределение нагрузки периферийный каркас.&lt;br /&gt;\n	- Не стесняющее активность ребенка просторное углубление под голову.&lt;br /&gt;\n	- Встроенный дождевик.&lt;br /&gt;\n	- Совместимость с системой подачи воды.&lt;br /&gt;\n	- Специальное отделение на молнии с втягивающимся дном для спального мешка (спальный мешок может быть размещен как внутри, так и снаружи рюкзака).&lt;br /&gt;\n	- Наличие 2-х карманов в клапане рюкзака.&lt;br /&gt;\n	- Сделанные из эластичной нейлоновой сетки передний и боковые карманы.&lt;br /&gt;\n	- Петля, предназначенная для крепления ледового инструмента.&lt;br /&gt;\n	- Специальные точки для фиксации ледового инструмента.&lt;br /&gt;\n	- Карман из сетчатого материала для МР3 плеера или мобильного телефона на лямке рюкзака.&lt;/p&gt;&lt;p&gt;\n Расцветка: &lt;a href=&quot;/index.php?route=product/search&amp;filter_tag=Cherry Shake&quot; target=&quot;_blank&quot;&gt;&lt;strong&gt;Cherry Shake&lt;/strong&gt;&lt;/a&gt;&lt;/p&gt;\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n&lt;p&gt;\n Мы рекомендуем вам &lt;strong&gt;купить &lt;a href=&quot;/rukzaki&quot;&gt;рюкзак Osprey&lt;/a&gt;&lt;/strong&gt; в интернет-магазине Osprey, потому что мы разбираемся в рюкзаках! У нас работает удобная и быстрая доставка рюкзаков Osprey по Киеву и Украине. Также вы можете выбрать вариант &lt;strong&gt;самовывоза рюкзака Osprey&lt;/strong&gt; из нашего офиса, который находится неподалеку от станции метро Вокзальная.&lt;/p&gt;\n&lt;p&gt;\n &lt;strong&gt;Рюкзаки Osprey &ndash; это наивысшее качество по доступным ценам! &lt;/strong&gt;&lt;/p&gt;', 'Osprey Ace 48L Cherry Shake - функциональный рюкзак с вентилируемой спинкой для юных путешественников. Брендовый магазин Osprey - (044) 599-55-56', 'osprey ace cherry shake', '', '');
