INSERT INTO `return` (`return_id`, `order_id`, `date_ordered`, `customer_id`, `firstname`, `lastname`, `email`, `telephone`, `return_status_id`, `comment`, `date_added`, `date_modified`) VALUES
(11, 1447, '2013-08-12', 410, 'Константин', 'Кузин ', 'uaukr@rambler.ru', '0634605272', 2, 'Добрый день!\r\nТакая ситация сложилась. Взял у Вас рюкзак Kestrel 68 синий размера M/L. Он оказался велик, плечевый лямки плотно не сидят на плечах из за бОльшей спинки и рюкзак как бы отваливаеся назад.\r\nХотел спросить о возможности обмена на такой же любого цвета но размера S/M. или возрата. \r\nСитуация осложняется тем, что собрался в поход и поезд уходит в этот четверг.\r\nПрошу ответить.\r\nСпасибо.', '2013-08-17 13:12:58', '2013-08-17 13:12:58'),
(12, 1692, '2014-05-05', 459, 'Александр', 'Рекуха', 'stuaromny@mail.ru', '0971040861', 2, '', '2014-05-05 17:57:12', '2014-05-05 17:57:12'),
(13, 1741, '2014-06-22', 467, 'Сергей Владимирович', 'Савенков', 'elfenleid@mail.ru', '0935541060', 2, '', '2014-06-22 17:36:08', '2014-06-22 17:36:08'),
(14, 2134, '2015-07-20', 552, 'Jack', 'Guy', 'jackalbertguy@gmail.com', '07712236875', 2, '', '2015-07-20 03:01:22', '2015-07-20 03:01:22');
