INSERT INTO `review` (`review_id`, `product_id`, `customer_id`, `author`, `text`, `rating`, `status`, `date_added`, `date_modified`) VALUES
(60, 146, 0, 'Пользователь', 'Рюкзак дуже сподобався. Багато вміщає і разом з тим якщо не наповнений є дуже компактним.', 5, 1, '2013-11-13 14:44:44', '0000-00-00 00:00:00'),
(61, 45, 0, 'без имени', 'давно хотел купить - цена кусалась, все же купил - не пожалел. ', 5, 1, '2014-02-24 09:14:11', '0000-00-00 00:00:00'),
(62, 43, 0, 'Антон', 'Недавно взял себе для небольшого похода.\r\nРюкзак выдержал абсолютно все нагрузки! Прочный, надежный и емкий!\r\nО покупке абсолютно не жалею и всем рекомендую!', 5, 1, '2014-03-04 11:25:25', '0000-00-00 00:00:00'),
(107, 519, 0, 'Александр', 'Подскажите рекомендуемую (максимальную) нагрузку этого рюкзака..', 5, 1, '2015-05-14 18:24:00', '0000-00-00 00:00:00'),
(108, 519, 0, 'Команда Osprey', 'Этот рюкзак литрожом 28 литров. Соответственно, не рекомендуется перегружать его свыше максимальной вместимости.', 5, 1, '2015-05-14 18:27:17', '0000-00-00 00:00:00'),
(59, 73, 0, 'Artur', 'Отличный рюкзак!\r\nОчень понравился дизайн! Давно хотел что-то такое!\r\nВместительный и стильный)))\r\nБольшое спасибо!', 5, 1, '2013-09-30 14:25:46', '0000-00-00 00:00:00'),
(56, 200, 0, 'Василий', 'Купил жене для катания на велосипеде.\r\nПо цвету и по емкости рюкзак отлично подошел!\r\nДа и цвет ей очень понравился.\r\nЛично мне понравилась спинка, потому что очень хорошо продувается.', 5, 1, '2013-09-30 14:25:04', '0000-00-00 00:00:00'),
(57, 41, 0, 'Len4ik', 'Недавно купила мужу на подарок.\r\nОстался доволен))\r\nЦвет, карманы, лямки, спинка - все понравилось!)))', 5, 1, '2013-09-30 14:25:17', '0000-00-00 00:00:00'),
(58, 56, 0, 'Антон', 'Недавно взял его себе для велопоездок и пока что никаких изьянов не нахожу.\r\nУдобно сидит, не мешает при езде.\r\nДостаточно многофункционален.\r\nРекомендую!\r\n', 5, 1, '2013-09-30 14:25:30', '0000-00-00 00:00:00'),
(55, 149, 0, 'Olenka', 'Надзвичайно класний рюкзак!\r\nКупувала його для тренувань.\r\nВсередину можна покласти багаторечей.\r\nДо того ж колір веселий і практичний))', 5, 1, '2013-09-30 14:24:38', '0000-00-00 00:00:00'),
(54, 45, 0, 'Владимио', 'Купил данный рюкзак для поездки.\r\nОчень понравилось то, что его можно использовать как сумку и переносить с помощью удобной ручки.\r\nТакже порадовало большое количество отделений.', 5, 1, '2013-09-30 14:24:25', '0000-00-00 00:00:00'),
(52, 40, 0, 'Анюта', 'Взяла себе данную модель для университета, и осталась довольна.\r\nЦвет просто отличный!\r\nЯркий,веселый))\r\nК тому же рюкзак достаточно вместительный!\r\nВсем советую!', 5, 1, '2013-09-30 14:24:02', '0000-00-00 00:00:00'),
(53, 146, 0, 'Den4ik', 'Увидел недавно эту модель у друга и сразу захотел себе такой же!\r\nНевероятно вместительный, практичный и удобный рюкзак!\r\nПокупкой доволен на все 100%', 5, 1, '2013-09-30 14:23:51', '0000-00-00 00:00:00'),
(63, 78, 452, 'Максим', 'Давно искал себе рюкзак для повседневного использования, и вот - нашел. Эта модель именно то что мне было нужно. Советую всем, берите - не пожалеете!', 5, 1, '2014-03-20 12:48:09', '0000-00-00 00:00:00'),
(64, 44, 0, 'Vladimir', 'Модель просто отличная! Расцветка сразу очень понравилась, а также понравилось то, что рюкзак можно и как сумку использовать, перенося его за ручку.\r\nОчень классный рюкзак)', 5, 1, '2014-05-26 12:43:48', '0000-00-00 00:00:00'),
(65, 31, 0, 'Лана', 'Отличный треккинговый рюкзак. Очень удобная спинка. Вместителен. Советую!', 5, 1, '2014-05-26 18:02:46', '0000-00-00 00:00:00'),
(66, 148, 0, 'Серега', 'Хороший рюкзак. Я ношу его и в городе и в командировки беру и путешествую вместе с ним. Очень удачный цвет.', 5, 1, '2014-05-26 18:04:56', '0000-00-00 00:00:00'),
(67, 124, 0, 'Юрчик', 'Рюкзак просто БОМБА!\r\nКупа відділень, все регулюється так, як тобі треба.\r\nМатеріал дуже якісний! Одним словом - мрія)', 5, 1, '2014-05-28 17:54:21', '0000-00-00 00:00:00'),
(68, 143, 0, 'Слава', 'Вчера заехал в данный интернет-магазин и забрал такую модель.\r\nКачество - супер! Функциаонал - супер!\r\nРюкзак сам по себе очень нравится.\r\nСпасибо!', 5, 1, '2014-05-28 17:54:18', '0000-00-00 00:00:00'),
(69, 35, 0, 'Алика', 'Прекрасный рюкзак прекрасного спокойного света. Вместителен и самое главное - крайне удобный!  Спина на месте, руки и плечи тоже. Все швы качественно прострочены, в общем, мне понравилось. Цена кусючая, но он того стоит.', 5, 1, '2014-05-29 14:03:01', '0000-00-00 00:00:00'),
(70, 270, 0, 'Сюьзи', 'Взяла себе такой на велике путешествовать по городу. ПИтьевая система это нечто. Здорово. Мне очень нравится.', 5, 1, '2014-05-29 14:25:56', '0000-00-00 00:00:00'),
(71, 75, 0, 'Galya', 'Otli4nuu gorodskoy rukzak. Otli4nuy tsvet. 4asto ezgy v komandirovki na nedalekie rastoyaniya i etot rukzak to 4to nyjno v moem sly4ae.', 5, 1, '2014-05-29 14:26:02', '0000-00-00 00:00:00'),
(72, 280, 0, 'Ярик', 'Рюкзак просто суперский! Никаких минусов не нашел. Дизайн отличный, карманов куча и качество на высоте. Вобщем всем советую!', 5, 1, '2014-05-29 17:16:02', '0000-00-00 00:00:00'),
(73, 284, 0, 'Vetal', 'Купил данный рюкзак, потому что очень удобно можна пользоваться планшетом, не вытаскивая его из рюкзака.\r\nДля метро очень удобно))', 5, 1, '2014-05-30 17:34:17', '0000-00-00 00:00:00'),
(74, 42, 0, 'Іван', 'Дуже сподобалась дана модель.\r\nДуже яскравий колір і дуже якісний матеріал!\r\nРюкзак просто супер))', 5, 1, '2014-06-02 17:41:40', '0000-00-00 00:00:00'),
(75, 39, 0, 'Алла', 'Купила себе вчера такой))\r\nЦвет очень понравился)) Очень яркий!)', 5, 1, '2014-06-03 17:14:26', '0000-00-00 00:00:00'),
(76, 125, 0, 'Fanny', 'Это у меня уже второй рюкзак этого бренда. Я теперь понимаю, почему такова цена этих вещей - потому что они клевые! Чувствуется, что в вещь вкладывалась энергия и любовь. Покупайте, не пожалеете.', 5, 1, '2014-06-03 18:28:44', '0000-00-00 00:00:00'),
(77, 206, 0, 'Кати', 'очень удобная спинка у этого рюкзака. спина не болит, а я люблю грузить его по самое не могу. в общем, классные делает рюкзаки этот бренд.', 5, 1, '2014-06-03 18:28:37', '0000-00-00 00:00:00'),
(78, 240, 0, 'Машуля', 'У мужа точно такой же только мужской))\r\nМне очень понравился, поэтому взяла такой женский вариант для себя)) Очень классный рюкзачок))', 5, 1, '2014-06-04 17:33:30', '0000-00-00 00:00:00'),
(79, 150, 0, 'Gen4ik', 'Очень крутой рюкзак))\r\nЕмкий, с классным дизайном...вобщем есть все что нужно!))', 5, 1, '2014-06-05 17:41:31', '0000-00-00 00:00:00'),
(80, 124, 0, 'Askiro', 'Доброго времени суток!\r\nВопрос к менеджерам интернет-магазина: кроме объёма эта модель отличается ли функционально от модели  Osprey Momentum 34? Видел видео на Youtube, где студент-медик из США довольно детально показывал все детали модели с объёмом 34 л. Особенно заинтересовало наличие боковых ручек и возможность трансформировать рюкзак: складывать лямки и ремешки в ниши в спинке рюкзака, придавая, таким образом, вид более офисного аксессуара. Вот ссылка: http://www.youtube.com/watch?v=ISdTuOVAGxc\r\nДля меня это важный момент для покупки: эти модели, кроме объёма, идентичны в своих функциональных возможностях?', 5, 1, '2014-06-11 17:21:16', '0000-00-00 00:00:00'),
(81, 124, 0, 'Osprey', 'Здравствуйте, Askiro!\r\nФункционально Momеntum 30L практически не отличается от своего предшественника, Momentum 34L.\r\nВсе остально почти так же, как и было.\r\nСоветуем вам посмотреть вот этот видеообзор:\r\nhttp://www.youtube.com/watch?v=mOS4COm6Fdk', 5, 1, '2014-06-11 17:35:28', '0000-00-00 00:00:00'),
(82, 122, 0, 'Григорий', 'Очень удобная модель. У меня была такая же, только старая...на 34 литра. Но эта нравится больше хотя бы тем, что спинка уже намного удобней и лучше вентилируется. А по функционалу рюкзак как был превосходным, таким и остался.', 5, 1, '2014-06-12 17:50:40', '0000-00-00 00:00:00'),
(83, 77, 0, 'Дана', 'Очень яркий рюкзачок! И очень удобный))', 5, 1, '2014-06-13 17:51:50', '0000-00-00 00:00:00'),
(84, 145, 0, 'Гриша', 'Купил такой по совету друга...больше друга у меня нет.\r\nШучу))\r\nРюкзак очень классный! Ёмкий, стильний и крепкий)', 5, 1, '2014-06-16 17:10:41', '0000-00-00 00:00:00'),
(85, 76, 0, 'Гарик', 'Отличный рюкзак! И ноут влез без проблем на 15 дюймов!))\r\nБольшое спасибо)', 5, 1, '2014-06-17 17:37:30', '0000-00-00 00:00:00'),
(86, 71, 0, 'Ваня', 'взял себе такой, потому что люблю классические рюказки. этот отлично подошёл. прям как в детстве))', 5, 1, '2014-06-19 17:54:30', '0000-00-00 00:00:00'),
(87, 38, 0, 'Лиза', 'Вчера такой забрала в магазине) ОЧЕНЬ яркий рюкзак!))', 5, 1, '2014-06-20 17:14:16', '0000-00-00 00:00:00'),
(88, 74, 0, 'Надя', 'Взяла себе такой)) Очень люблю яркие вещи)) Никаких претензий по качеству нет!))\r\nРюкзак действительно стоит каждой копейки!', 5, 1, '2014-06-24 17:08:56', '0000-00-00 00:00:00'),
(89, 78, 0, 'Катя', 'Купила себе такой рюкзак. Ребята доставили быстро. Рюкзак оригинальный - проверено:)Теперь у меня есть друг на каждый день.спасибо ', 5, 1, '2014-07-11 13:32:18', '0000-00-00 00:00:00'),
(90, 284, 0, 'Sky', 'Давно искал себе что-то более официальное чем просто рюкзак. Для города и офиса, можно и на встречу с таким рюкзаком, как-то официально выглядит. Много карманов, функционал на высоком уровне) Мне очень нравится!', 5, 1, '2014-07-11 13:32:13', '0000-00-00 00:00:00'),
(91, 45, 0, 'Роман', 'Рюкзак чудовий!\r\nА яка питна система підійде до нього - Osprey Hydraulics 3L !?', 5, 1, '2014-09-10 19:50:49', '0000-00-00 00:00:00'),
(92, 436, 0, 'Виталий', 'Привіт, цікавить рюкзак,  скажіть будь-ласка в комплекті є накидка від дощу???', 2, 1, '2014-10-23 10:38:29', '0000-00-00 00:00:00'),
(93, 150, 0, 'Виталий', 'Рюкзак продуман до мелочей. Материалы очень качественные. Пошив на самом высоком уровне. Рекомендую!!! ', 5, 1, '2014-10-23 10:43:13', '0000-00-00 00:00:00'),
(94, 436, 0, 'osprey.kiev.ua', 'Доброго дня! Накидки від дощу в комплекті немає', 5, 1, '2014-10-23 10:43:02', '0000-00-00 00:00:00'),
(95, 124, 0, 'Артем', 'Купил этот рюкзак вместе с гидросистемой на 3 литра. всем очень доволен, менеджер специально проверял помещается ли туда гидросистема, что свидетельствует о бережном отношении к клиентам)', 5, 1, '2014-10-23 13:23:40', '0000-00-00 00:00:00'),
(96, 45, 0, 'Андрей', 'влюбился в этот рюкзак) спасибо за оперативную доставку!', 5, 1, '2014-10-23 13:23:58', '0000-00-00 00:00:00'),
(97, 280, 0, 'ссс', 'я в восторге от количества отделений и дизайна! спасибо за отличный рюкзак', 5, 1, '2014-10-23 13:24:23', '0000-00-00 00:00:00'),
(98, 189, 0, 'Виталий', 'Очень удобный и красивый рюкзак,ношу как в повседневной жизни так и на велопрогулках. Очень доволен компактностью и функционалом', 5, 1, '2014-10-23 13:24:13', '0000-00-00 00:00:00'),
(99, 239, 0, 'Анна', 'Дизайн просто отпад! Количество отделений и качество ткани тоже не может на радовать!', 5, 1, '2014-10-23 13:24:05', '0000-00-00 00:00:00'),
(100, 44, 497, 'Mila (Kharkiv)', 'Чудесный рюкзак! Сегодня забрала со службы доставки - сплошной восторг! Osprey окончательно стал нашим фаворитом )) Цвет не яркий, а приятный насыщенный. Объем тот, что надо. И вещи в дорогу на 2-3 дня взять, и в город выбежать за мелкими покупками, и в однодневный поход-прогулку захватить. Качество и прочность - как всегда на высоте!\r\nP.S. Теперь в семье 4 рюкзака Osprey :)) 2 походных (Aether 70, Ariel 55) и 2 городских (Quantum 34, Comet 28).', 5, 1, '2014-11-27 13:52:33', '0000-00-00 00:00:00'),
(101, 150, 0, 'Сергей', 'Отличный рюкзак. Одно небольшое &quot;но&quot; - спинка лишена жесткости, сам рюкзак очень легкий, и сетка на лямках достаточно скользкая. Поэтому чтобы комфортно носить рюкзак на спине, дабы не сползал, нужно, чтобы в нем что-то лежало, иначе будет не очень удобно. То же самое, если вы привыкли его ставить на колени в транспорте. Ношу в нем папку для утяжеления. В остальном доволен абсолютно всем, особенно прекрасным качеством пошива, материалами, молниями, дизайном и эргономикой. Нес в нем тридцать с чем-то кг железяк для гантелей - выдержал на ура, не скрипнул даже. Нес ноутбук, и попал под сильный дождь - компьютер не намок. Доволен! Безусловно, рюкзак стоит своих денег. ', 5, 1, '2014-11-27 13:53:17', '0000-00-00 00:00:00'),
(102, 142, 0, 'Людмила', 'ЧУДОВА РІЧЬ !!!!  Неймовірне відчуття свободи!!! Із старшою донькою в мене не було можливості піти в гори на протязі 3-х років,а вже з малим Андрійком ми разом покорили вершину Хомяк , коли йому було 6 місяців (в ерго рюкзачку) і трохі пізніше ми їздили і спали в цій чудовій переносці :-)) ', 5, 1, '2015-02-04 18:07:51', '0000-00-00 00:00:00'),
(103, 494, 502, 'Андрей', 'На первый взгляд хороший рюкзак, но сильно пахнет. Уже 2е суток провисел на балконе все еще пахнет. Подскажите все Ваши рюкзаки имеют такой аромат?)', 4, 1, '2015-02-04 18:05:32', '0000-00-00 00:00:00'),
(104, 494, 0, 'Команда Osprey', 'Андрей, мы впервые сталкиваемся с таким отзывом. Раньше не было жалоб на запах рюкзаков, да и сидя в шоуруме, где их несколько десятков, запаха никакого нет. ', 5, 1, '2015-02-04 18:07:35', '0000-00-00 00:00:00'),
(105, 361, 0, 'Александр', 'Я профессиональный велогонщик и уже кучу гидраторов перепробовал. То клапан сломается, то резервуар лопнет. \r\nЭтой системой пользуюсь уже год и претензий вообще никаких нет! ', 5, 1, '2015-03-05 17:03:17', '0000-00-00 00:00:00'),
(106, 60, 0, 'Андрей', 'Клевый рюкзак! У меня такой уже пол года и никаких претензий. Очень удобный!', 5, 1, '2015-03-24 15:37:38', '0000-00-00 00:00:00'),
(109, 348, 0, 'Виктор', 'Хорошо, что есть такие расходные материалы. Так случилось, что прежний потерялся, и уже было расстроился, но то, что такие мелочи все же продаются отдельно, очень порадовало! ', 5, 1, '2015-05-22 15:56:43', '0000-00-00 00:00:00'),
(110, 494, 0, 'Виталий', 'На первый взгляд компактный, но очень вместительный. Выбирал долго и выбор пал именно на него, о чем я лично не пожалел ни разу. Претензий никаких!', 5, 1, '2015-05-22 16:06:21', '0000-00-00 00:00:00'),
(111, 266, 0, 'Николай', 'Не первый год пользуюсь товарами Osprey. Все очень качественное. Что касается именно этой модели, рюкзак удобный и легкий. Трамбую в него все. Его хватит даже для поездки к бабушке)))', 5, 1, '2015-05-22 16:06:30', '0000-00-00 00:00:00'),
(112, 353, 0, 'Иван', 'Рад, что есть такие мелочи. Думал уже придется новую систему заказывать, ан -нет)) Спасибо)', 5, 1, '2015-08-04 18:47:10', '0000-00-00 00:00:00'),
(113, 449, 0, 'Тарас', 'Пользуюсь уже больше года. Все супер, катаюсь очень часто, и каждый день его ношу - класс)', 5, 1, '2015-08-04 18:47:26', '0000-00-00 00:00:00'),
(114, 264, 0, 'Костя', 'Брал на подарок заядлому велосипедисту - он в восторге, ну и я  тоже) Спасибо!', 5, 1, '2015-08-04 18:47:18', '0000-00-00 00:00:00'),
(115, 266, 0, 'Руслан', 'Отличный рюкзак!Рекомендую! вместительный. все швы аккуратно прострочены. порадовало количество карманов и их наличие на поясном ремне. это очень удобно если есть мелочи, которые нужно постоянно доставать.', 5, 1, '2016-01-12 13:14:44', '0000-00-00 00:00:00'),
(116, 104, 0, 'Руслан', 'Отличный рюкзак!Рекомендую! вместительный. все швы аккуратно прострочены. порадовало количество карманов.', 5, 1, '2015-08-12 14:04:26', '0000-00-00 00:00:00'),
(117, 277, 0, 'Эльдар', 'Ходил с этим рюкзаком недели две и впечатления о нем только хорошие. Спина сделана основательно, удобно, мягко. Лямки широкие и упругие. На поясе есть кармашки. Фурнитура хорошая. Лично для себя минусов не нашел.', 5, 1, '2015-08-14 17:26:30', '0000-00-00 00:00:00'),
(118, 300, 0, 'Кирилл', 'Клевая сумка. Есть всё что мне нужно. Самое прикольное это - возможность использовать планшет не вытаскивая его из сумки. ', 5, 1, '2015-08-17 16:36:16', '0000-00-00 00:00:00'),
(119, 263, 0, 'Саша', 'Рюкзак просто суперррр. Проверку проходил в Карпатах. Дождь,холод,ветер ему ни по чем!!! Шлейки очень удобные,широкие и мягкие. Даже много вещей не тяжело было тащить\r\n', 5, 1, '2015-08-17 16:51:40', '0000-00-00 00:00:00'),
(120, 293, 0, 'Антон', 'Пользуюсь месяц. У меня свободно влазит ноут 15,4&quot;, планшет, зарядные,мышка и тетради. Ткань не маркая, очень устойчивая к загрязнениям,хорошо держит форму как наполненный так и пустой. Постоянно езжу в метро, и очень удобно пользоваться планшетом не доставая его из рюкзака.', 5, 1, '2015-08-17 18:08:22', '0000-00-00 00:00:00'),
(121, 282, 0, 'Женя', 'Не рюкзак , а находка! Езжу с ним в универ и на курсы. Помещаются все тетради, распечатки, перекус. Места просто завались.Ноут не болтается по всему рюкзаку и не боишься им долбануться где-то. ', 5, 1, '2015-09-30 10:11:29', '0000-00-00 00:00:00'),
(122, 28, 0, 'Иван', 'Рюкзак довольно легкий, удобный, отличнейшего качества и вместительный. Я очень долго искал подходящий для меня рюкзак и остановился на этом. Ни дня не пожалел о своем выборе! Пользуюсь уже года два. ', 5, 1, '2015-10-12 16:08:57', '0000-00-00 00:00:00'),
(123, 382, 611, 'Олександр', 'Товар замовив, одразу подзвонили уточнили чи все ок з замовленням, одразу уточнили на яке відділення відправити якщо не підійде по розмірам на відділення в якому я хочу отримати товар. Товар приїхав швидко) все круто все нове оригінальне з бірочками)) все як має бути, наплічник зручний, легкий, можна використовувати щоденно для прогулянок містом якщо лінь нести щось в карманах чи руках) ноутбук 15.4 влізає добре, думаю що і 17 теж мав би влізти, місця не багато, якраз достатньо для всього необхідного) покупкою задоволений) дякую)\r\nП.С. В коплекті з наплічником отримав промокод на знижку що порадувало)', 5, 1, '2016-01-12 13:14:32', '0000-00-00 00:00:00'),
(124, 681, 0, 'Нина', 'Отличный небольшой рюкзак с удобными и крепкими лямками. Компактно складывается, места в сумке почти не занимает. ', 5, 1, '2016-01-12 13:13:07', '0000-00-00 00:00:00'),
(125, 277, 0, 'Александр', 'Прошел с рюкзаком уже 5 походов. Скрипит немного спина, потерлись боковые части пояса. По гарантии прислали спину с плечевыми лямками - порвались. Видимо перележал он на складе.\r\n\r\nТеперь о хорошем - очень навороченный рюкзак с точки зрения прибамбасов и кармашков. Единсвенное что удивляет - НЕТ дождевика в комплекте.\r\n\r\nБерите, если не боитесь мелких недочетов. Более технологичного рюкзака не бывает!', 4, 1, '2016-01-28 10:45:25', '0000-00-00 00:00:00'),
(126, 494, 0, 'Сергей', 'Интересует размер отделения для ноутбука и вот по какой причине. Рюкзак планирую использовать не только как повседневный, но и в качестве удобства переноски 17&quot; ноутбука. На официальном сайте указаны такие размеры: Max laptop sleeve dimensions (mm) 430 (w) x 320 (h) x 47.5 (d); а размеры самого рюкзака: Maximum dimensions : (cm) 48 (l) x 28 (w) x 28 (d). Что-то не сходится - как может ширина рюкзака быть 3 см а отделения для ноута 32?? Размер моего ноутбука 41,5 х 28,06 х 3,9 см. Проcьба укажите точные размеры отделения для ноутбука, замерьте) Заранее спасибо. ', 5, 1, '2016-04-26 11:19:26', '0000-00-00 00:00:00'),
(127, 23, 0, 'Виктор', 'В пользовании 2 года. Рост мой 189см, размер L cидит как положено 9для тех, кто мучается с выбором размера, как я когда-то) Рюкзаком очень доволен. Спина не потеет летом, до 10 кг на велике или пешком без проблем. С молниями проблем нет, только лучше смазать воском или др. Рюк очень легкий. Много чего можно прицепить к нему (например спиннинг с катушкой). не пожалел ни разу что купил недешевый рюказк. Единственный минус - неудобно ставить на землю (падает) и все футболки в области поясницы в катышках (но так наверно от многих синтетических царапающих материалов рюкзаков). ', 5, 1, '2016-03-09 14:52:36', '0000-00-00 00:00:00'),
(128, 474, 0, 'Игорь', 'Купил такой рюкзак, всем доволен.', 5, 1, '2016-03-09 14:52:43', '0000-00-00 00:00:00'),
(129, 278, 0, 'Руслан', 'Продал 2 своих рюкзака, и по акции купил этот, если б не акция не купил бы )))\r\nВес более чем на 1 кг ниже чем того что у меня был в идентичным литражом.\r\nТакой тип конструкции спины очень удивлял и вызывал недоверие, пока не попробовал, теперь и я в их числе тех, кто хвалят этот рюкзак.\r\nПояс разгрузки и спина, при правильной регулировке, настолько удобно садиться что сложно передать (ну это не аксиома, надо пробовать).\r\nТкань и швы прочные, фурнитура надёжная.\r\n\r\nЗачем 2 кармана на клапане, не понятно. Силикон на спине вытирается со временем. Ремни боковые немного не продуманы. Нет дождевой накидки. Боковые карманы и передний, большой, вещевой сделаны  из сетчатого материала и сучки и ветки им не понравятся. Через чур глубокие боковые карманы.\r\nДля облегчения я б убрал внутреннею перегородку между отделениями, любую боковую молнию (оставил бы одну), и ту вставку на клапане. \r\n', 5, 1, '2016-03-09 14:53:21', '0000-00-00 00:00:00'),
(130, 192, 0, 'Max', 'Отличный рюкзак - рекомендую', 5, 1, '2016-04-20 15:45:45', '0000-00-00 00:00:00'),
(131, 254, 0, 'Ростислав', 'Очень крутой рюкзак. Я брал его специально как дополнительный к моему Aether 70. Он удобно крепится к рюкзаку, а когда появляется необходимость в небольшом рюкзаке, то его просто отстегивать. Еще одна его  крутая фишка - это его спинка. Вентиляционная вкладка вынимается и может служить седушкой!) Он идеален как самостоятельный и для вылазок в лесопарк и для долгих походов как дополнительный. Всем советую! ', 5, 1, '2016-04-26 11:16:02', '0000-00-00 00:00:00'),
(132, 494, 0, 'Команда Osprey', 'Сергей, размеры отделения для ноутбука указаны в миллиметрах, а размер рюкзака в сантиметрах. Этот рюкзак отлично подходит для вашего ноутбука.', 5, 1, '2016-04-26 12:35:31', '0000-00-00 00:00:00'),
(133, 106, 0, 'Илья', ' пользуюсь уже два года. Так как я геодезист, то ношу его  практически не снимая 300 дней в году ))) И могу сказать что это действительно очень удобный и качественный рюкзак. Он легкий и прочный, не протерся и не порвался, хотя я его нещадно бросал и в кузов грузовика и мок он под всеми дождями. Советую всем!', 5, 1, '2016-05-10 11:16:14', '0000-00-00 00:00:00'),
(134, 568, 656, 'Ira', 'Столкнулась с проблемой что не было отзывов о рюкзаках Osprey. Полторы недели назад купила рюкзак Osprey Flare 22L Oasis Blue и хочу поделиться впечатлениями. С виду он выглядит большим для небольшой девушки как я (160 см.), но на спине он очень гармоничный. Как показано на фотографии много карманчиков и разных отделений. Отдел для ноутбука построен так что ноутбук в подвешенном состоянии. Если рюкзак поставить на пол, то ноутбук не достает до земли. Большое отделение довольно большое. Из-за подвешенного кармана для ноутбука кажется что отдел меньше чем он есть на самом деле. Пока что очень довольна и думаю что так будет и дальше. Юзала пока что только по городу, в путешествие не выбиралась. Надеюсь кому-то мой отзыв будет полезен.', 5, 1, '2016-06-02 15:28:46', '0000-00-00 00:00:00'),
(135, 73, 0, 'Anton', 'Удобнейшая вещь! Очень продуманы всякие мелочи, кармашки всякие, отражатели. Да и по вместительности для городского рюкзака - очень даже хорошо. Рекомендую', 5, 1, '2016-06-02 15:28:56', '0000-00-00 00:00:00'),
(136, 752, 0, 'Андрей', 'Рюкзак очень хороший. Брал себе для Карпат. Объемный, надежный, свободно помещается одежда на неделю, палатка, каремат, спальник и небольшой котелок.', 5, 1, '2016-07-02 16:17:54', '0000-00-00 00:00:00'),
(137, 674, 0, 'Петя', 'Для велика самое то!\r\nЛегкий и удобный))', 5, 1, '2016-07-02 16:18:01', '0000-00-00 00:00:00'),
(138, 662, 0, 'Марк', 'Ношу его с прошлого лета и понял, что такого удобного рюкзака у меня еще не было! Мягенькие лямки и спинка хорошая. Вообще то что нужно!', 5, 1, '2016-07-02 16:18:09', '0000-00-00 00:00:00'),
(139, 484, 0, 'Лена', 'Очень удобный и довольно большой рюкзак. Брала его для поездок в другой город. Удобные отделения. Планшет и ноут в них безопасно перевозить. Много места для вещей и косметики.', 5, 1, '2016-07-05 13:08:43', '0000-00-00 00:00:00'),
(140, 470, 0, 'Андрей', 'Классный рюкзак. Удобно с ним ездить и в транспорте и на велике. Компрессионные ремни часто пригождаются что бы уменьшить объем. Всем советую.', 5, 1, '2016-07-05 13:08:37', '0000-00-00 00:00:00'),
(141, 325, 0, 'Алина', 'Очень удобная сумка для поездок. Маневренная и легкая, несмотря на большой объем. Не переворачивается и устойчиво стоит на колесиках когда катишь ее даже по не очень ровной дороге.', 5, 1, '2016-07-05 13:08:30', '0000-00-00 00:00:00'),
(142, 516, 0, 'Марина', 'Пользуюсь рюкзаком уже год практически ежедневно. Качество хорошее. За все время нет ни потертостей ни разрывов. Ноут удобно носить, много вмещается вещей, на спине сидит удобно и в руках носить комфортно. Но при большой загрузке в руках его переносить не стоит. Слишком натягивается шов в том месте где ручка пришита к рюкзаку. Не мешало бы его укрепить.', 5, 1, '2016-07-26 14:01:17', '0000-00-00 00:00:00'),
(143, 472, 0, 'Настя', 'Удобный большой рюкзак. Есть специальное место для планшета и ноутбука. Мне очень нравится брать его в поездки и командировки. ', 5, 1, '2016-11-23 12:05:44', '0000-00-00 00:00:00');
